<style >
	:root{
		/* general color scheme */
		color-scheme: light dark;

		/* property that controls the toggle od desktop and mobile */
		--mobile: 0;
		--safe-area-inset-top: env(safe-area-inset-top, 0px);
		--safe-area-inset-bottom: env(safe-area-inset-bottom, 0px);
		--safe-area-inset-left: env(safe-area-inset-left, 0px);
		--safe-area-inset-right: env(safe-area-inset-right, 0px);

		/* and other styling properties */
		--body-padding: 2%;
		--header-height: calc(8dvh + var(--safe-area-inset-top));
		--footer-height: calc(50px + var(--safe-area-inset-bottom));
		--footer-height-2: minmax(316px,15lvh) ;

		/* all the elements that will be animated */
		will-change: transform, height, background-color, box-shadow, border-radius,position;
		
		/* application general grid structure */
		--grid--mobile-collums: var(--body-padding) [content-start] repeat(6,1fr) [content-end] var(--body-padding);
		--grid-collums-gutter: 1rem;
		--grid-collums-rows: [header-start] var(--header-height) [header-end main-start] 2fr [main-end footer-start] var(--footer-height-2) [footer-end];
		--grid-collums-rows-gutter: 1rem;

		/* property that controls the toggle od desktop and mobile */
		@property --mobile{
			syntax: "<number>"; 
			initial-value: 0;
			inherits: true;
    	}
	}

	:global(*):is(:focus-visible) {
		outline: 2px solid var(--primary-orange-500);
		outline-offset: 2px;
	}

	:global(html){
		overscroll-behavior-x: contain;
		overscroll-behavior-y: contain;
		overflow: hidden;
	}

	:global(body){
		width: 100%;
		margin: 0;
		padding: 0;
		overflow-x: hidden;
		overflow-y: auto;
		max-height:100lvh;
		height: 100lvh;
		overscroll-behavior-x: contain;
		overscroll-behavior-y: contain;
		color: var(--general-text-color);
		background-color: transparent;
	}
	
	:global(.body-container){
		display: grid;
		grid-template-columns: var(--body-padding) [content-start] repeat(12,1fr) [content-end] var(--body-padding);
		grid-template-rows: [header-start] var(--header-height) [header-end main-start] min(calc(100dvh - var(--header-height)),100%) [main-end footer-start] minmax(316px,15dvh) [footer-end];
		min-height: 100dvh;
		background-color: var(--general-background-color);
		overflow-x: clip;
		overscroll-behavior-x: contain;
		overscroll-behavior-y: contain;
	}
	
	:global(header){
		grid-row: header;
		grid-column: 1/-1;
		z-index: 100;
		
		container-type: inline-size;
		container-name:header;
	}
	
	:global(main) {
		background-color: var(--general-background-color);
		grid-row: main;
		grid-column: content;
		display: grid;
		grid-template-columns: subgrid;
		align-content: start;
		overflow-x: hidden;
		overflow-y: visible;
		
		container-name: main;

		/* grid positioning for all main content */
		&:nth-of-type(1)  {
			position: relative;
			grid-row: main;
			display: grid;
			grid-template-columns: subgrid;
			align-content: start;
			overflow-x: clip;
		}
				
		&:nth-of-type(1) > :is(:global(*)) {
			grid-column: 1/ span 1;
			grid-row: 1/span 1;
		}

		&:nth-of-type(1):has(:global(*) ~ :global(*)) > :nth-child(n)  {
			grid-column: auto;
			grid-row: 1 / span 1;
			height: fit-content;
			text-wrap: nowrap;
			width: 100%;
		}
	}

	:global(body:is(.windows-device, .desktop-device, .macos-device) main){
		background-color: transparent;
		overflow: hidden;
	}

	:global(body:is(.windows-device, .desktop-device, .macos-device) main > svg){
		position: absolute;
		height: 100dvh !important;
		width: stretch !important;
		inset-inline: 0;
		inset-block: 0;
		z-index: 0;
		scale: 1.5;
		isolation: isolate;
		opacity: 1;
		transition: opacity 0.3s ease;
		
		@starting-style{
			opacity: 0;
		}
	}

	:global(body main > svg path){
		/* fill: color-mix(in srgb, var(--general-background-color) 65%, var(--primary-purple-400) ); */
		fill: color-mix(in srgb, var(--general-background-color) 82%, var(--primary-darkgreen-200));
		filter: blur(10px);
		transition: 0.3s ease;
		
		@starting-style{
			fill: var(--general-background-color);
		}
	}

	footer{
		position: relative;
		grid-row: footer;
		grid-column: 1/-1;
		display: grid;
		grid-template-columns: subgrid;
		
		container-type: inline-size;
		container-name: footer;
	}

	@media screen and (width < 901px){
		:global(main:nth-of-type(1)) {
			overflow-y: visible;
		}
	}

	/* media query for mobile view */
	@media 
		(-webkit-min-device-pixel-ratio: 3) and (display-mode: standalone),
